package com.Switch;

public class Switchcase {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int numbers = 20;
		switch (numbers) {
		case 10:
			System.out.println("1");
			break;

		case 20:
			System.out.println("2");
			break;
		case 3:
			System.out.println("10");

			break;
		default:
			System.out.println("not present");

		}
	}
}